//autogenerated:yes
//nolint:revive,govet,errcheck
package ardupilotmega

import (
	"testing"

	"github.com/stretchr/testify/require"
)

func TestEnum_MAV_REMOTE_LOG_DATA_BLOCK_COMMANDS(t *testing.T) {
	t.Run("zero", func(t *testing.T) {
		var e MAV_REMOTE_LOG_DATA_BLOCK_COMMANDS
		e.UnmarshalText([]byte{})
		e.MarshalText()
		e.String()
	})

	t.Run("first entry", func(t *testing.T) {
		enc, err := MAV_REMOTE_LOG_DATA_BLOCK_STOP.MarshalText()
		require.NoError(t, err)

		var dec MAV_REMOTE_LOG_DATA_BLOCK_COMMANDS
		err = dec.UnmarshalText(enc)
		require.NoError(t, err)

		require.Equal(t, MAV_REMOTE_LOG_DATA_BLOCK_STOP, dec)
	})
}
